import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./pages/Home";
import Menu from "./pages/Menu";
import Order from "./pages/Order";
import OrderSummary from "./pages/OrderSummary";
import ClientInfo from "./pages/ClientInfo";
import EndScreen from "./pages/EndScreen";
import { useState } from "react";
const data = [
  {
    id: 1,
    name: "Burgers",
    imageUrl:
      "https://upload.wikimedia.org/wikipedia/commons/thumb/4/47/Hamburger_%28black_bg%29.jpg/500px-Hamburger_%28black_bg%29.jpg",
  },
  {
    id: 3,
    name: "Hot Dogs",
    imageUrl:
      "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTWUmIyoASMjGZYNJwQ3xEgbV925i9-bzQ3Aw&usqp=CAU",
  },
  {
    id: 4,
    name: "Sides",
    imageUrl:
      "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcREjDguNcerBeqDAWsjTMlxpchoOCg6u8CaTQ&usqp=CAU",
  },
  {
    id: 5,
    name: "Drinks",
    imageUrl:
      "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTDRAv02QnyhM54fl14G131vhba1ZkU8Jh-Qw&usqp=CAU",
  },
];

function App() {
  const [menu, setMenu] = useState(data);
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="menu/" element={<Menu list={menu} />} />
        <Route path="order/" element={<Order />} />
        <Route path="summary/" element={<OrderSummary />} />
        <Route path="info/" element={<ClientInfo />} />
        <Route path="order/completed" element={<EndScreen />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
